import React from 'react';
import '../App.css';
import PropTypes from 'prop-types';

const movies = [
  {
    title: 'Movie Title 1',
    subtitle: 'Movie Subtitle 1',
    storyline: 'Movie Storyline 1',
    rating,
    imagePath: 'images/movie_1',
  },
  {
    title: 'Movie Title 2',
    subtitle: 'Movie Subtitle 2',
    storyline: 'Movie Storyline 2',
    rating,
    imagePath: 'images/movie_2',
  },
  {
    title: 'Movie Title 3',
    subtitle: 'Movie Subtitle 3',
    storyline: 'Movie Storyline 3',
    ratingThree,
    imagePath: 'images/movie_3',
  },
];

class MovieList extends React.Component {
  render() {
    const movieList = movies.map((movie, index) => (
      <section key={ index }>
        <h2>{ this.propsmovie.title}</h2>
        <p>{ movie.subtitle }</p>
        <p>{ movie.storyline }</p>

        <img src={ movie.imagePath } alt={ movie.title } />
      </section>
    ));
    return ({ movieList });
  }
}

MovieList.prototype = {
  movies: PropTypes.shape({
    title: PropTypes.string.isRequired,
    subtitle: PropTypes.string.isRequired,
    storyline: PropTypes.string.isRequired,
    rating: PropTypes.number.isRequired,
    ratingThree: PropTypes.number.isRequired,
  }),
};

MovieList.default = {
  title: 'Un-title',
  subtitle: 'Un-subtitle',
  storyline: 'Non storyline',
  rating: 0,
  ratingThree: 0,
};

export default MovieList;
